INSERT INTO `go_article` VALUES (1,'2','Charles','了解网站','','','a:2:{i:0;s:33:\"photo/20130902/41484375056924.jpg\";i:1;s:33:\"photo/20130902/26578125056924.jpg\";}','','','<p>	</p><p><br/></p><p><br/></p><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">毕沃思闪购是一种新型的网购模式，只需1元就有可能买到一件商品。<span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px; color: rgb(102, 102, 102); text-indent: 28px;\">毕沃思</span></span><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; text-indent: 2em;\">闪购网把一件商品平分成若干“等份”出售，每份1元，当一件商品所有“等份”售出后抽出一名幸运者，该幸运者即可获得此商品。</span></p><h3 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">规则：</span></h3><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px;\"><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">1、每件商品参考市场价平分成相应“等份”，每份1元，1份对应1个闪购码。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">2、同一件商品可以购买多次或一次购买多份。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">3、当一件商品所有“等份”全部售出后计算出“幸运闪购码”，拥有“幸运闪购码”者即可获得此商品。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">4、幸运闪购码计算方式：</span></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p style=\"padding: 0px 0px 0px 36px; margin-top: 0px; margin-bottom: 0px; text-indent: -1em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp;1.取该商品最后购买时间前网站所有商品100条购买时间记录</span><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; text-indent: -1em;\">（限时揭晓商品取截止时间前网站所有商品100条购买时间记录）</span></span></p><p style=\"padding: 0px 0px 0px 36px; margin-top: 0px; margin-bottom: 0px; text-indent: -1em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">2.时间按时、分、秒、毫秒依次排列组成一组数值。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; height: 10px;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">3.将这100组数值之和除以商品总需参与人次后取余数，余数加上10,000,001即为“幸运闪购码”</span></p><h3 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><strong><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">流程：</span></strong></span></h3><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><strong style=\"padding: 0px; margin: 0px;\">1、挑选商品</strong></span></p><p style=\"padding: 0px; margin-bottom: 15px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;分类浏览或直接搜索商品，点击“立即1元闪购”。</span></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><strong style=\"padding: 0px; margin: 0px;\">2、支付1元</strong></span></p><p style=\"padding: 0px; margin-bottom: 10px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;通过在线支付平台，支付1元即购买1人次，获得1个“闪购码”。同一件商品可购买多次或一次购买多份，购买的“闪购码”越多，获得商品的几率越大。</span></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><strong style=\"padding: 0px; margin: 0px;\">3、揭晓获得者</strong></span></p><p style=\"padding: 0px; margin-bottom: 15px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;当一件商品达到总参与人次，抽出1名商品获得者，<span style=\"font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; text-indent: 28px;\">毕沃思</span>闪购网会通过手机短信或邮件通知您领取商品。</span></p><h3 style=\"padding: 0px 0px 0px 22px; margin: 0px; font-size: 14px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">注：</span></h3><p style=\"padding: 0px; margin-bottom: 10px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">1）商品揭晓后您可登录&quot;我的闪购&quot;查询详情，未获得商品的用户不会收到短信或邮件通知；</span></p><p style=\"padding: 0px; margin-bottom: 10px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">2）商品揭晓后，请及时登录&quot;我的闪购&quot;完善个人资料，以便我们能够准确无误地为您配送商品。</span></p><p style=\"padding: 0px; margin-bottom: 10px; text-indent: 1.6em;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">3）所有已揭晓商品均不给予退款</span></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><strong style=\"padding: 0px; margin: 0px;\">4、晒单分享</strong></span></p><p style=\"padding: 0px; margin-bottom: 0px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;晒出您收到的商品实物图片甚至您的靓照，说出您的闪购心得，让大家一起分享您的快乐。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得一定的积分奖励。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp;在您成功晒单后，您的晒单会出现在网站&quot;晒单分享&quot;区，与大家分享喜悦。</span></p><p><br/></p>',50,1,1375862513,NULL),(2,'2','Charles','常见问题','','','a:0:{}','','','<p></p><h4 class=\"mat0\" style=\"padding: 0px; margin: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">1、怎样查看我参与的商品有没有中奖？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp; &nbsp; 每件商品开奖结果公布之后，登录网站，进入&quot;我的用户中心&quot;，在&quot;我中奖的商品&quot;中即可查询中奖情况。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">2、我获得了商品，我还需要支付其他费用吗？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>不需要支付其他任何费用。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">3、当我获得商品以后我该做什么？</span></h4><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp;在您获得商品后您会收到站内信、短信和电子邮件的通知。在这之后，您必须在“我的闪购”正确填写、真实的收货地址，完善或确认您的个人信息。我们会在您获得商品后3个工作日内通过电话方式与您取得联系。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">4、商品是正品吗？怎么保证？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>我们承诺，所有商品100%正品，可享受厂家所提供的全国联保服务，享受商品的保修、换货和退货的义务（国家三包政策）。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">5、如何晒单分享？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>在您收到商品后，登录网站，进入&quot;我的闪购&quot;，在“晒单分享”区发布晒单信息，通过审核后，您还可获得一定的积分奖励。在您成功晒单后，您的晒单会出现在网站“晒单分享”区，与大家分享喜悦。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">6、我收到的商品可以换货或者退货吗？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>非质量问题，不在三包范围内，不给予退换货。</span></p><h4 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">7、参与毕沃思闪购需要注意什么？</span></h4><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><span style=\"