or: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">1、释义</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;闪购码：指<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>用户成功参与闪购之后获得的随机分配编码。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;幸运闪购码：指某件商品所有编码售出后，<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>网根据规则计算出的一个编码，持有该编码的用户即可获得该商品。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px;\"><br/></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">2、<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>网承诺遵循以下的原则运营网站，确保所有用户在<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>网中享受同等的权利与义务。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;平等原则：用户和<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>在交易过程中具有同等的法律地位。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;自由原则：用户享有自愿向<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>参与购买商品的权利，任何人不得非法干预。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;公平原则：用户和<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>行使权利、履行义务应当遵循公平原则。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp;诚实信用原则：用户和<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; text-indent: 28px;\">极光闪购</span>行使权