;;\">毕沃思闪购拥有国内庞大的消费群体及专业高效的电子商务平台，</span></p><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">诚意邀请各品牌供应商与我们达成商务合作，共同创造中国电子商务的美好明天。</span></p><h3 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">市场推广</span></h3><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">随着<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px;\">毕沃思</span>闪购发展壮大以及全国各地市场的开拓，</span></p><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">欢迎拥有市场推广、广告合作资源的您与我们携手共进，共同发展。 携手共进。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;电 话：18672393060</span></p><p class=\"bottom-space20px\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;邮 箱：<span style=\"font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;\">33634420@qq.com</span></span></p><h3 style=\"padding: 0px; margin: 30px 0px 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">媒体关注</span></h3><p class=\"textindent\" style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">随着<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px;\">毕沃思</span>闪购的发展，欢迎各类媒体前来沟通指导，同时欢迎各类内容合作策划传播，你们的关注和支持，采访以及报道，将成为<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px; text-indent: 28px;\">毕沃思</span>闪购成长历程不可或缺的一部分。</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal;\"><br/></p><p><br/></p>',61,1,1408798466,NULL),(14,'16','Frozen','购物公益','','','a:0:{}','','','<p>	</p><p><br/></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">一、闪购基金是极光闪购创始人发起成立的以公益事业为主要方向的爱心基金。闪购基金本着“我为人人，人人为我”的社会责任，向需要帮助的困难人们提供爱心捐助。</span></p><p><br/></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">二、每位在极光闪购进行分享购物的朋友，您的每次参与都将是为我们的公益事业做出一份贡献。当您每参与1人次闪购，将由极光闪购出资为闪购基金筹款0.01元，所筹款项将全部用于闪购基金。</span></p><p><br/></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">三、闪购基金将会以第1种途径或第2种途径进行使用：<br/>1、极光闪购全体员工将组织向身边的公益事业进行捐赠与关怀活动。活动内容包括：资金、所需用品以及探望与协助等，每次捐赠与关怀活动结束后闪购基金将公布活动详情以及基金详细使用报告。<br/>2、闪购基金通过腾讯公益或壹基金等公益组织进行爱心捐赠。</span></p><p><br/></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">四、包括闪购基金的捐赠活动，我们不定期开展内部全体员工对身边更多公益事业或实时公益事业进行爱心捐赠的社会活动。</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp; &nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp; &nbsp; 我们还将不定期邀请幸运者参与并见证我们的基金社会活动，共同为我们的社会责任付出一份爱心与力量。当活动启动前我们会将活动进行公告，您可自愿或自行组织参与，组成闪购大家庭，共同开启活动之行。凡参与社会活动的幸运者均能获得极光闪购为您精心准备的公益爱心礼品一份。</span></p><p><br/></p>',63,1,1414361199,NULL);
